  // given the active filters:
  const get_options = grp => grp.top(Infinity).filter(d => d.value > 0).map(d => d.key);

  // update the options given a selector, the options, and a lookup table
  const update_options = (selector, option_data, lookup, sortKey = "label") => {
    let options = select(selector).selectAll("option").data(option_data, function (d) {
      return d || this.value;
    });
    options.exit().remove();
    const optionsEnter = options.enter().append("option").text(d => lookup[d]).attr("value", d => d);
    options = options.merge(optionsEnter);
    if (sortKey === "label") {
      options.sort(function (a, b) {
        return lookup[a].localeCompare(lookup[b]);
      });
    } else {
      options.sort(function (a, b) {
        return a - b;
      });
    }
  };

